import React from 'react';
import zIndex from '@material-ui/core/styles/zIndex';

let url = 'BG.jpg'
const ShowCase = () => {
    return (
        <div style={{backgroundColor: 'rgba(0,0,0,0.5)'}}>
            <div style={{
                background: "url(" + require("./BG.jpg") + ") center",
                backgroundSize: 'cover',
                height: '50vh',
                zIndex: -1}}>
            </div>
        </div>
    )
}

export default ShowCase;
